import React, { useState } from 'react';
import Cell from './Cell'
import './Table.css';

const Table = () => {
    const [turn, setTurn] = useState();

    return (
        <div className="container">
            <table className="table">
                <tbody>
                    <tr>
                        <Cell id={0} turn={turn} setTurn={setTurn} />
                        <Cell id={1} turn={turn} setTurn={setTurn} />
                        <Cell id={2} turn={turn} setTurn={setTurn} />
                    </tr>
                    <tr>
                        <Cell id={3} turn={turn} setTurn={setTurn} />
                        <Cell id={4} turn={turn} setTurn={setTurn} />
                        <Cell id={5} turn={turn} setTurn={setTurn} />
                    </tr>
                    <tr>
                        <Cell id={6} turn={turn} setTurn={setTurn} />
                        <Cell id={7} turn={turn} setTurn={setTurn} />
                        <Cell id={8} turn={turn} setTurn={setTurn} />
                    </tr>
                </tbody>
            </table>
        </div>
    );
}

export default Table;
